import { useEffect, useRef, useState } from "react";
import styled from "styled-components";
import { ReactComponent as EccLogo } from "../Resource/svg/EccLogo.svg";
import GlobalFont from "../Resource/font/fonts";
import {
  SignUpContainer,
  SignUpInputAreaContainer,
  SignUpInputArea,
} from "./AuthenticationStyleComponent";

const SignUp = () => {
  const EccText = styled.h3`
    font-family: "roboto";
    color: #3763ff;
    opacity: 0.4;
  `;
  return (
    <SignUpContainer>
      <EccLogo style={{ margin: "auto" }} />
      <GlobalFont />
      <EccText>EXPANDED CORE CURRICULUM</EccText>
      <SignUpInputAreaContainer>
        <SignUpInputArea placeholder="이름을 입력해 주세요"/>
        <SignUpInputArea placeholder="생년원일 6자리를 입력해주세요 ex)001122"/>
        <div style={{'display':'flex','justifyContent':'center','alignItems':'center' ,'width':'100%','margin':'auto'}}>
        <SignUpInputArea style={{'width':'70%'}} placeholder="이메일을 입력해주세요"/>
        <button style={{'width':'20%','height':'2.5rem','position':'relative','left':'-3%'}}>중복확인</button></div>
        <SignUpInputArea />
        <SignUpInputArea />
      </SignUpInputAreaContainer>
    </SignUpContainer>
  );
};

export default SignUp;
